import React, { useEffect, useState, useContext } from "react";
import { NavLink } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./DynamicPage.css";

const DynamicPage = () => {
  const [currentPage, setCurrentPage] = useState(1);
  const moviesPerPage = 15;

  // Sample movie data (hardcoded)
  const movies = [
    { movieImage: "data:image/jpeg;base64,", Title: "Inception", Year: "2010" },
    { movieImage: "data:image/jpeg;base64,", Title: "Interstellar", Year: "2014" },
    { movieImage: "data:image/jpeg;base64,", Title: "The Dark Knight", Year: "2008" },
    { movieImage: "data:image/jpeg;base64,", Title: "Pulp Fiction", Year: "1994" },
    { movieImage: "data:image/jpeg;base64,", Title: "The Matrix", Year: "1999" },
    { movieImage: "data:image/jpeg;base64,", Title: "Fight Club", Year: "1999" },
    { movieImage: "data:image/jpeg;base64,", Title: "Forrest Gump", Year: "1994" },
    { movieImage: "data:image/jpeg;base64,", Title: "The Godfather", Year: "1972" },
    { movieImage: "data:image/jpeg;base64,", Title: "Inception", Year: "2010" },
    { movieImage: "data:image/jpeg;base64,", Title: "Interstellar", Year: "2014" },
    { movieImage: "data:image/jpeg;base64,", Title: "The Dark Knight", Year: "2008" },
    { movieImage: "data:image/jpeg;base64,", Title: "Pulp Fiction", Year: "1994" },
    { movieImage: "data:image/jpeg;base64,", Title: "The Matrix", Year: "1999" },
    { movieImage: "data:image/jpeg;base64,", Title: "Fight Club", Year: "1999" },
    { movieImage: "data:image/jpeg;base64,", Title: "Forrest Gump", Year: "1994" },
    { movieImage: "data:image/jpeg;base64,", Title: "The Godfather", Year: "1972" },
    { movieImage: "data:image/jpeg;base64,", Title: "Inception", Year: "2010" },
    { movieImage: "data:image/jpeg;base64,", Title: "Interstellar", Year: "2014" },
    
  ];

  const totalPages = Math.ceil(movies.length / moviesPerPage);

  const handlePageChange = (pageNumber) => {
    setCurrentPage(pageNumber);
  };

  const createPagination = () => {
    const paginationButtons = [];
    if (totalPages <= 1) return paginationButtons;

    paginationButtons.push(
      <li key="1" className={`page-item ${currentPage === 1 ? "active" : ""}`}>
        <button className="page-link" onClick={() => handlePageChange(1)}>
          1
        </button>
      </li>
    );

    if (currentPage > 4) {
      paginationButtons.push(
        <li key="start-ellipsis" className="page-item disabled">
          <span className="page-link">...</span>
        </li>
      );
    }

    for (
      let i = Math.max(2, currentPage - 2);
      i <= Math.min(totalPages - 1, currentPage + 2);
      i++
    ) {
      paginationButtons.push(
        <li
          key={i}
          className={`page-item ${currentPage === i ? "active" : ""}`}
        >
          <button className="page-link" onClick={() => handlePageChange(i)}>
            {i}
          </button>
        </li>
      );
    }

    if (currentPage < totalPages - 3) {
      paginationButtons.push(
        <li key="end-ellipsis" className="page-item disabled">
          <span className="page-link">...</span>
        </li>
      );
    }

    paginationButtons.push(
      <li
        key={totalPages}
        className={`page-item ${currentPage === totalPages ? "active" : ""}`}
      >
        <button
          className="page-link"
          onClick={() => handlePageChange(totalPages)}
        >
          {totalPages}
        </button>
      </li>
    );

    return paginationButtons;
  };

  const indexOfLastMovie = currentPage * moviesPerPage;
  const indexOfFirstMovie = indexOfLastMovie - moviesPerPage;
  const currentMovies = movies.slice(indexOfFirstMovie, indexOfLastMovie);

  return (
    <div className="container mt-5 dynamic-body">
      <div className="text-center mb-4">
        <h1>Showing Results for Movies</h1>
      </div>
      <div className="row">
        {movies.map((movie) => (
          <div className="card mb-4 fixed-card" key={movie.Title}>
            <NavLink
              to={`/description/${movie.Title}`}
              className="card-link"
              style={{ textDecoration: "none" }}
            >
              <img
                src={movie.movieImage}
                alt={movie.Title}
                className="card-img-top fixed-image"
              />
              <div className="card-body">
                <p className="card-text title">{movie.Title}</p>
                <p className="card-text">{movie.Year}</p>
              </div>
            </NavLink>
          </div>
        ))}
      </div>
      <nav>
        <ul className="pagination justify-content-center">
          {createPagination()}
        </ul>
      </nav>
    </div>
  );
};

export default DynamicPage;
